function Counter() {
  const [count,setcount] = useState(0)
  console.log(count)
  const incrementcounter=()=>{setcount(count+1)}
  return (
    <div>
      <h1>{count}</h1>
      <button onClick={incrementcounter}>Click</button>
    </div>
  )
}

export default Counter
